import React from 'react';
import '../C_login/style_login.css';
import ReactTooltip from "react-tooltip";
import { Link } from 'react-router-dom';

function LoginButton() {
  
    return (    
      <div class="login_button"> 
        
          <input type="submit" value="Submit" data-tip data-for="loginbuttonId"></input>
          <ReactTooltip id="loginbuttonId" place="bottom" effect="">
            Click here to Log In
          </ReactTooltip>  
          <Link to="/dashboard">Dashboard
        </Link>              
        <Route
            path="/dashboard"
            component={Dashboard} 
        />
      </div>
    );
  }
  
  export default LoginButton;
